import React from 'react';
import { Link } from 'react-router-dom';

const AptitudeLearning = () => {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Aptitude Learning</h1>
      <ul className="list-disc pl-5">
        <li>
          <Link to="/aptitude/logic" className="text-blue-500 hover:underline">
            Logical Reasoning
          </Link>
        </li>
        <li>
          <Link to="/aptitude/numerical" className="text-blue-500 hover:underline">
            Numerical Aptitude
          </Link>
        </li>
        <li>
          <Link to="/aptitude/verbal" className="text-blue-500 hover:underline">
            Verbal Ability
          </Link>
        </li>
        {/* Add more headings/topics as needed */}
      </ul>
    </div>
  );
};

export default AptitudeLearning;
